  false,\n\t\"url\": null,\n\t\"notes\": \"This document is the Final Comprehensive
  Conservation Plan, Environmental Impact Statement, Wilderness Review, and Wild River
  Plan (CCP/EIS/WR/WRP) for the Yukon Delta National Wildlife Refuge. It describes
  five alternatives for managing the refuge and identifies the possible consequences
  of implementing these alternatives. Each alternative provides broad policy guidance
  for managing the refuge. Each alternative also identifies lands suitable for wilderness
  designation. An overview of the Refuge is provided along with information about
  the planning process. Public involvement; potential problems affecting fish, wildlife,
  and habitats; and a description of the affected environment are provided.\",\n\t\"license_title\":
